 {'answer': '', 'meta': {'score': -1}, 'provenance': array([{'bleu_score': -1.0, 'start_character': -1, 'start_paragraph_id': 1, 'end_character': -1, 'end_paragraph_id': 1, 'meta': {'fever_page_id': '', 'fever_sentence_id': -1, 'annotation_id': '-1', 'yes_no_answer': '', 'evidence_span': array(['The prehistory of the United States comprises the occurrences within regions now part of the United States of America during the interval of time spanning from the formation of the Earth to the documentation of local history in written form. At the start of the Paleozoic era, what is now "North" America was actually in the southern hemisphere. Marine life flourished in the country\'s many seas, although terrestrial life had not yet evolved. During the latter part of the Paleozoic, seas were largely replaced by swamps home to amphibians and early reptiles. When the continents had assembled into Pangaea drier conditions prevailed. The evolutionary precursors to mammals dominated the country until a mass extinction event ended their reign.',
               'The prehistory of the United States comprises the occurrences within regions now part of the United States of America during the interval of time spanning from the formation of the Earth to the documentation of local history in written form. At the start of the Paleozoic era, what is now "North" America was actually in the southern hemisphere. Marine life flourished in the country\'s many seas, although terrestrial life had not yet evolved. During the latter part of the Paleozoic, seas were largely replaced by swamps home to amphibians and early reptiles. When the continents had assembled into Pangaea drier conditions prevailed. The evolutionary precursors to mammals dominated the country until a mass extinction event ended their reign.\rhighlight sentence(s) containing evidence, not only the answer'],
